import React from 'react';

const MemeCard = ({ meme }) => {
    return (
      <div className="meme-card" style = {{backgroundColor: "#f0f0f0"}}>
        <img className="meme-img" src={meme.url} alt={meme.name} />
        <h4>{meme.name}</h4>
      </div>
    );
  };

  export default MemeCard;

